class Gaussian {
public:
  Gaussian() {
    wb = 3;
    we = 61;
    sb = 1.0;
    se = 15;
    ss = 0.1;    
  };
  ~Gaussian() {};

  double *getKernel(int width, double sigma) {
    double *kernel;
    
    // check width
    if((width % 2) == 0) {
      stringstream str;
      str << "width must be odd";
      throw(str.str());
    }
    if(width < wb || width > we) {
      stringstream str;
      str << "width out of range: " << wb << " < width < " << we;
      throw(str.str());
    }

    // check sigma
    if(sigma < sb || sigma > se) {
      stringstream str;
      str << "sigma out of range: " << sb << " < sigma < " << se;
      throw(str.str());
    }

    // calculate array address
    int w = (width - wb)/2;
    int s = (int)(rint((sigma - sb)/ss));

    // return the kernel
    kernel = new double[width];
    for(int i = 0; i < width; i++) {
      kernel[i] = gaussian[w][s][i];
    }
    return kernel;

  }

private:
  int wb;
  int we;
  double sb;
  double se;
  double ss;
};
